import React from 'react';
import {
  AppBar, Toolbar, Typography
} from '@mui/material';
import './TopBar.css';
import FetchModel from '../../lib/fetchModelData';

/**
 * Define TopBar, a React component of project #5
 */
class TopBar extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      app_version: undefined,
    };
  }

  componentDidMount() {
    this.handleAppVersionChange();
  }

  handleAppVersionChange(){
    const app_version = this.state.app_version;
    if (app_version === undefined){
        FetchModel("/test/info")
            .then((response) => {
                this.setState({
                    app_version: response.data
                });
            });
    }
  }

  render() {
    const { app_version } = this.state;
    const base64Logo = "data:image/png;base64,";

    return app_version ? (
      <AppBar className="topbar-appBar" position="absolute">
        <Toolbar className='topbar'>
          <img src={base64Logo} alt="BitMasters Logo" style={{ height: '60px', marginRight: '10px' }} />
          
          <Typography variant="h5" color="inherit">
             {this.props.topName}
          </Typography>
          <Typography variant="h5" component="div" color="inherit">
              Version: {this.state.app_version.__v}
          </Typography> 
        </Toolbar>
      </AppBar>
    ) : (
      <div />
    );
  }
}

export default TopBar;
